import React from "react";
import "../styles/global.css";

const Skills = () => {
  return (
    <div className="skills">
      <h1>Skills</h1>
      <div className="skill-list">
        <span>React</span>
        <span>JavaScript</span>
        <span>UI/UX Design</span>
      </div>
    </div>
  );
};

export default Skills;
